import React from "react";

import "./footer.css";
import {Container, Row, Col, ListGroup, ListGroupItem} from "reactstrap";
import {Link} from "react-router-dom";
import logo1 from "../../assets/images/logo1.png";

const quick__links = [
    {
        path:'/home',
        display:'Home'
    },
    {
        path:'/about',
        display:'About'
    },
    {
        path:'/entreprises',
        display:'Services'
    },
];

const quick__links2 = [
    {
        path:'/login',
        display:'Login'
    },
    {
        path:'/register',
        display:'Register'
    },
];


const Footer = () => {
    return (
        <footer className="footer">
            <Container>
                <Row>
                    <col lg="3">
                        <div className="logo">
                            <img src={logo1} alt="" />
                            

                        </div>
                    </col>
                </Row>
            </Container>
        </footer>

    );

};
export default Footer;
